    "2016-07-27T22:56:04.987436",nt"name": "determine-disturbance-impacts-of-fireworks-at-the-coquille-point-seabird-colony-complex-ne",nt"isopen":
    false,nt"url": null,nt"notes": "The USFWS conducted a monitoring study
    at Pirate Cove Rock during 2011 to determine if the Independence Day fireworks display
    had any adverse effects on seabirds, particularly breeding success. USFWS also included
    the Coquille Point Seabird Colony Complex as a monitored site due to similar concerns
    at that location. To assess potential impacts, USFWS biologists monitored seabirds
    before, during, and after the fireworks displays using a combination of aerial and
    land-based techniques. The objective of this study was to document any level of
    fireworks-related impacts, including identifying any potential disturbance, u201ctakeu201d,
    or 50 CFR violations to surface-nesting colonial seabirds near the fireworks display
    locations during Independence Day celebrations.",nt"license_title": "License
